import React from 'react'
import {useNavigate} from 'react-router-dom'

function Button(props) {
    

    const navigate = useNavigate();
  const goback = () =>{
  navigate('/');
  } ;
  return (
    <div> 
         <button id='btn'onClick={()=>goback() } >{props.name}</button>
         </div>
  )
}

export default Button
